// src/components/ProjectForm.js
import { useState, useEffect } from 'react';
import API from '../services/api';
import socket from '../socket';

const ProjectForm = ({ closeModal, currentProject, setProjects, projects }) => {
  const [name, setName] = useState('');
  const [description, setDescription] = useState('');
  const [deadline, setDeadline] = useState('');
  const [status, setStatus] = useState('en cours');
  const [pdf, setPdf] = useState(null);

  // Si on modifie un projet existant → pré-remplir le formulaire
  useEffect(() => {
    if (currentProject) {
      setName(currentProject.name || '');
      setDescription(currentProject.description || '');
      setDeadline(currentProject.deadline ? currentProject.deadline.split('T')[0] : '');
      setStatus(currentProject.status || 'en cours');
    }
  }, [currentProject]);

  const handleSubmit = async (e) => {
    e.preventDefault();

    const formData = new FormData();
    formData.append('name', name);
    formData.append('description', description);
    formData.append('deadline', deadline);
    formData.append('status', status);
    if (pdf) formData.append('pdf', pdf);

    try {
      let response;
      if (currentProject) {
        // Modification
        response = await API.put(`/projects/${currentProject._id}`, formData);
        setProjects(projects.map(p => p._id === currentProject._id ? response.data : p));
      } else {
        // Création
        response = await API.post('/projects', formData);
        setProjects([...projects, response.data]);
      }

      // Notification en temps réel
      socket.emit('updateProject', { projectId: response.data._id, action: currentProject ? 'update' : 'create' });

      closeModal();
    } catch (err) {
      alert('Erreur lors de la sauvegarde du projet');
      console.error(err);
    }
  };

  return (
    <div className="bg-white p-8 rounded-xl">
      <h2 className="text-2xl font-bold mb-6">
        {currentProject ? 'Modifier le projet' : 'Nouveau projet'}
      </h2>

      <form onSubmit={handleSubmit} className="space-y-5">
        <input
          type="text"
          placeholder="Nom du projet"
          value={name}
          onChange={(e) => setName(e.target.value)}
          required
          className="w-full px-4 py-3 border rounded-lg focus:ring-2 focus:ring-blue-500"
        />

        <textarea
          placeholder="Description"
          value={description}
          onChange={(e) => setDescription(e.target.value)}
          rows="4"
          className="w-full px-4 py-3 border rounded-lg focus:ring-2 focus:ring-blue-500"
        />

        <input
          type="date"
          value={deadline}
          onChange={(e) => setDeadline(e.target.value)}
          required
          className="w-full px-4 py-3 border rounded-lg"
        />

        <select
          value={status}
          onChange={(e) => setStatus(e.target.value)}
          className="w-full px-4 py-3 border rounded-lg"
        >
          <option value="en cours">En cours</option>
          <option value="fini">Terminé</option>
        </select>

        <div>
          <label className="block text-sm font-medium mb-2">PDF du projet (facultatif)</label>
          <input
            type="file"
            accept=".pdf"
            onChange={(e) => setPdf(e.target.files[0])}
            className="w-full"
          />
          {currentProject?.pdf && !pdf && (
            <p className="text-sm text-gray-600 mt-1">
              PDF actuel : <a href={`http://localhost:5000/${currentProject.pdf}`} target="_blank" rel="noopener noreferrer" className="text-blue-600 underline">Voir le fichier</a>
            </p>
          )}
        </div>

        <div className="flex justify-end space-x-4 pt-4">
          <button
            type="button"
            onClick={closeModal}
            className="px-6 py-3 border border-gray-300 rounded-lg hover:bg-gray-100"
          >
            Annuler
          </button>
          <button
            type="submit"
            className="px-8 py-3 bg-green-600 hover:bg-green-700 text-white font-bold rounded-lg"
          >
            Sauvegarder
          </button>
        </div>
      </form>
    </div>
  );
};

export default ProjectForm;
